import './App.css';
import { useState} from 'react';


function App() {

  const [boards, setBoards] = useState(
    { boards: 
      { title: 'To Do', 
        tasks: [{id: 0, body: 'wash the dishes'}, {id: 1, body: 'take out trash'}, {id: 2, body: 'portfolio'}, {id: 3, body: 'job search'}, 'learn Spanish', 'buy tickets']}})


  return (
    <div>
      {boards.map( board => {
        <div 
          className='board'
          id={board.title}
        >
          <h2>{board.title}</h2>
          {board.tasks.map( task => {
            <div>
              {task.body}
            </div>
          })}
        </div>
        })}
    </div>
  );
}

export default App;
